CREATE DATABASE domiyi_dbp;

USE domiyi_dbp;

CREATE TABLE user(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    email VARCHAR(50) NOT NULL,
    password VARCHAR(15) NOT NULL,
    name VARCHAR(40) NOT NULL,
    type INT NOT NULL,
    phone INT NOT NULL,
    address VARCHAR(30) NOT NULL,
    latitude BIGINT NOT NULL,
    length BIGINT NOT NULL,
    username VARCHAR(20) NOT NULL
);

CREATE TABLE orders(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    idCompany BIGINT NOT NULL,
    idUser BIGINT NOT NULL,
    idTransaction BIGINT NOT NULL,
    date TIMESTAMP NOT NULL,
    address VARCHAR(30) NOT NULL
);

CREATE TABLE product(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    idCompany BIGINT NOT NULL,
    idStatus BIGINT NOT NULL,
    name VARCHAR(80) NOT NULL,
    description TEXT,
    price DOUBLE NOT NULL,
    image VARCHAR(80),
    category INT,
    updated TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE transaction(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    paymentMethod INT NOT NULL,
    status INT
);

CREATE TABLE companyStatus(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    status INT NOT NULL
);

CREATE TABLE productStatus(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    status INT NOT NULL
);

CREATE TABLE detail(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    idOrder BIGINT NOT NULL,
    idProduct BIGINT NOT NULL,
    quantity BIGINT NOT NULL,
    observation TEXT
);

CREATE TABLE company(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    idStatus BIGINT NOT NULL,
    name VARCHAR(80) NOT NULL,
    image VARCHAR(100),
    idAdmin BIGINT NOT NULL,
    category INT,
    address VARCHAR(30) NOT NULL,
    latitude BIGINT NOT NULL,
    length BIGINT NOT NULL,
    deliveryCost DOUBLE NOT NULL,
    openHour INT NOT NULL,
    closeHour INT NOT NULL
);

CREATE TABLE store(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    idCompany BIGINT NOT NULL,
    address VARCHAR(30) NOT NULL,
    latitude BIGINT NOT NULL,
    length BIGINT NOT NULL,
    storeNumber INT NOT NULL,
    phone INT NOT NULL,
    email VARCHAR(50) NOT NULL
);

CREATE TABLE offer(
    id BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    idProduct BIGINT NOT NULL,
    price DOUBLE NOT NULL,
    status INT NOT NULL,
    CONSTRAINT fk_product FOREIGN KEY (idProduct) REFERENCES product(id)
    );

ALTER TABLE orders
    ADD CONSTRAINT fk_user FOREIGN KEY(idUser) REFERENCES user(id),
    ADD CONSTRAINT fk_company FOREIGN KEY(idCompany) REFERENCES company(id),
    ADD CONSTRAINT fk_transaction FOREIGN KEY(idTransaction) REFERENCES transaction(id);

ALTER TABLE product
     ADD CONSTRAINT fk_pro_status FOREIGN KEY (idStatus) REFERENCES productStatus(id),
     ADD CONSTRAINT fk_companies FOREIGN KEY (idCompany) REFERENCES company(id);

ALTER TABLE detail
    ADD CONSTRAINT fk_orders FOREIGN KEY (idOrder) REFERENCES orders(id);


ALTER TABLE company
    ADD CONSTRAINT fk_status FOREIGN KEY (idStatus) REFERENCES companyStatus(id);

ALTER TABLE store
    ADD CONSTRAINT fk_to_company FOREIGN KEY (idCompany) REFERENCES company(id);































































